import React from "react";
import Accordian from "../Components/accordians";
import "./Services.css";

function Services() {
  return (
    <React.Fragment>
      <Accordian count="01" style={{ width: "50%" }} />
      <div className="d-md-flex justify-content-around">
        <div>
          <h2>Helloo...</h2>
        </div>
        <div className="d-md-flex justify-content-around">
          <div>
            <Accordian count="1" />
            <Accordian count="2" />
            <Accordian count="3" />
          </div>
          <div>
            <Accordian count="4" />
            <Accordian count="5" />
            <Accordian count="6" />
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default Services;
